import React from 'react';
import '../index.css';
import auth from './Components/auth';

const Home = () => (

  <Query
    query={USERINFO}
  >
    {({ loading, error, data }) => {
      if (loading) return <p>Loading...</p>;
      if (error) return <p>Error :(</p>;
      if (data) return <p>{data.userInfo.username}{data.userInfo.wpm}</p>;
    }}
  </Query>
  );

export default Home;
